Line segment $\overline{AB}$ is extended past $A$ to $P$ such that $AP:PB = 1:4.$  Then
\[\overrightarrow{P} = t \overrightarrow{A} + u \overrightarrow{B}\]for some constants $t$ and $u.$  Enter the ordered pair $(t,u).$

[asy]
unitsize(1 cm);

pair A, B, P;

A = (0,0);
B = (5,1);
P = interp(A,B,-1/3);

draw(B--P);

dot("$A$", A, S);
dot("$B$", B, S);
dot("$P$", P, S);
[/asy]

In triangle $ABC,$ $a = 8,$ $b = 7,$ and $c = 5.$  Let $H$ be the orthocenter.

[asy]
unitsize(0.6 cm);

pair A, B, C, D, E, F, H;

B = (0,0);
C = (8,0);
A = intersectionpoint(arc(B,5,0,180),arc(C,7,0,180));
H = orthocenter(A,B,C);
D = (A + reflect(B,C)*(A))/2;
E = (B + reflect(C,A)*(B))/2;
F = (C + reflect(A,B)*(C))/2;

draw(A--B--C--cycle);
draw(A--D,dashed);
draw(B--E,dashed);
draw(C--F,dashed);

label("$A$", A, N);
label("$B$", B, SW);
label("$C$", C, SE);
label("$H$", H, SE, UnFill);

dot(H);
[/asy]

Then
\[\overrightarrow{H} = x \overrightarrow{A} + y \overrightarrow{B} + z \overrightarrow{C},\]where $x,$ $y,$ and $z$ are constants such that $x + y + z = 1.$  Enter the ordered triple $(x,y,z).$

There exist two complex numbers $c$, say $c_1$ and $c_2$, so that $-5 + 3i$, $8 - i$, and $c$ form the vertices of an equilateral triangle.  Find the product $c_1 c_2$.

[asy]
unitsize(0.5 cm);

pair A, B;
pair[] C;

A = (2,2);
B = (5,1);
C[1] = rotate(60,A)*(B);
C[2] = rotate(60,B)*(A);

draw(A--C[1]--B--C[2]--cycle);
draw(A--B);

dot("$-5 + 3i$", A, W);
dot("$8 - i$", B, E);
dot("$c_1$", C[1], N);
dot("$c_2$", C[2], S);
[/asy]

Given that
\begin{align*}
\cos x + \cos y + \cos z &= 0, \\
