\end{align*}find
\begin{align*}
&\tan^2 x + \tan^2 y + \tan^2 z - (\tan^2 x \tan^2 y + \tan^2 x \tan^2 z + \tan^2 y \tan^2 z) \\
&\quad  - 3 \tan^2 x \tan^2 y \tan^2 z.
\end{align*}

The distances from a point $P$ to five of the vertices of a regular octahedron are 3, 7, 8, 9, and 11.  Find the distance from $P$ to the sixth vertex.

[asy]
import three;

size(125);
currentprojection = perspective(6,3,1);

triple A, B, C, D, E, F, P;

A = (1,0,0);
B = (-1,0,0);
C = (0,1,0);
D = (0,-1,0);
E = (0,0,1);
F = (0,0,-1);
P = (1.2,1.5,1);

draw(A--P,red);
draw(B--P,red);
draw(C--P,red);
draw(D--P,red);
draw(E--P,red);
draw(F--P,red);

draw(A--C);
draw(A--D);
draw(A--E);
draw(A--F);
draw(C--E--D--F--cycle);
draw(D--B--C,dashed);
draw(B--C,dashed);
draw(B--D,dashed);
draw(B--E,dashed);
draw(B--F,dashed);

label("$P$", P, NE);
[/asy]

Let $z = 2 + \sqrt{2} - (3 + 3 \sqrt{2})i$, and let $c = 2 - 3i$.  Let $w$ be the result when $z$ is rotated around $c$ by $\frac{\pi}{4}$ counter-clockwise.

[asy]
unitsize(0.6 cm);

pair C, W, Z;

Z = (2 + sqrt(2), -3 - 3*sqrt(2));
C = (2,-3);
W = rotate(45,C)*(Z);

draw(Z--C--W);

dot("$c$", C, N);
dot("$w$", W, SE);
dot("$z$", Z, S);
label("$\frac{\pi}{4}$", C + (0.6,-1));
[/asy]

Find $w.$

Let $\mathbf{a} = \begin{pmatrix} -2 \\ 5 \end{pmatrix}$ and $\mathbf{b} = \begin{pmatrix} 1 \\ 3 \end{pmatrix}.$  Find the vector $\mathbf{c}$ so that $\mathbf{a},$ $\mathbf{b},$ and $\mathbf{c}$ are collinear, and $\mathbf{b}$ bisects the angle between $\mathbf{a}$ and $\mathbf{c}.$

[asy]
unitsize(0.5 cm);

pair A, B, C, O;

A = (-2,5);
B = (1,3);
O = (0,0);
C = extension(O, reflect(O,B)*(A), A, B);

draw(O--A,Arrow(6));
draw(O--B,Arrow(6));
draw(O--C,Arrow(6));
draw((-3,0)--(3,0));
draw((0,-1)--(0,6));
draw(interp(A,C,-0.1)--interp(A,C,1.1),dashed);

label("$\mathbf{a}$", A, NE);
label("$\mathbf{b}$", B, NE);
label("$\mathbf{c}$", C, NE);
[/asy]

The parametric curve $(x,y) = (\sin t, \sin 2t)$ is plotted below.

[asy]
unitsize(2 cm);

pair moo (real t) {
  return (sin(t),sin(2*t));
}

real t;
path foo = moo(0);

for (t = 0; t <= 2*pi + 0.1; t = t + 0.1) {
  foo = foo--moo(t);
}

draw((-1.2,0)--(1.2,0));
draw((0,-1.2)--(0,1.2));
draw(foo,red);
[/asy]

This curve can also be expressed in the form
\[ax^4 - bx^2 + cy^2 = 0,\]where $a,$ $b,$ and $c$ are positive integers.  Find the smallest possible value of $a + b + c.$

Three unit circles are drawn so they are mutually tangent, as shown below.  A blue circle that is externally tangent to all three unit circles is drawn.  Finally, three red circles are drawn, so that each red circle is externally tangent to two unit circles and externally tangent to the blue circle.  Then the radius of each red circle can be expressed in the form
\[\frac{a - b \sqrt{c}}{d},\]where $a,$ $b,$ $c,$ and $d$ are positive integers, when simplified.  Find $a + b + c + d$.

[asy]
unitsize(2 cm);

pair A, B, C, D, E, F, O;
real s = 2/sqrt(3) - 1, r = (9 - 4*sqrt(3))/33;

A = 2/sqrt(3)*dir(150);
B = 2/sqrt(3)*dir(30);
C = 2/sqrt(3)*dir(270);
O = (0,0);
D = (r + s)*dir(330);
E = (r + s)*dir(210);
F = (r + s)*dir(90);

filldraw(Circle(O,s),blue);
filldraw(Circle(D,r),red);
filldraw(Circle(E,r),red);
filldraw(Circle(F,r),red);
draw(Circle(A,1));
draw(Circle(B,1));
draw(Circle(C,1));
[/asy]

Let $\mathbf{a} = \begin{pmatrix} 7 \\ - 1 \\ 4 \end{pmatrix}$ and $\mathbf{b} = \begin{pmatrix} 3 \\ 1 \\ 2 \end{pmatrix}.$  Find the vector $\mathbf{c}$ so that $\mathbf{a},$ $\mathbf{b},$ and $\mathbf{c}$ are collinear, and $\mathbf{b}$ bisects the angle between $\mathbf{a}$ and $\mathbf{c}.$

[asy]
unitsize(0.5 cm);

pair A, B, C, O;

A = (-2,5);
B = (1,3);
O = (0,0);
C = extension(O, reflect(O,B)*(A), A, B);

draw(O--A,Arrow(6));
draw(O--B,Arrow(6));
draw(O--C,Arrow(6));
draw(interp(A,C,-0.1)--interp(A,C,1.1),dashed);

label("$\mathbf{a}$", A, NE);
label("$\mathbf{b}$", B, NE);
label("$\mathbf{c}$", C, NE);
[/asy]
